import Info from './Info';

function Navbar() {
  return (
    <div className='navbar'>
    <div className='navbar-right'>
      <p>Home
      About
      Projects
      Chat with me</p>
    </div>
    <div className='navbar-left'>
        <Info />
    </div>
    </div>
  )
}

export default Navbar;
